import React from 'react';
import Header from "../components/Header";
import Hero from "../components/Hero";
import { ShowItem } from "../components/ShowItem";
import Newsletter from "../components/Newsletter";
import Footer from "../components/Footer";

import Data from "../data/store-items.json";

import item1 from "../img/item-1.png";
import item2 from "../img/item-2.png";
import item3 from "../img/item-3.png";
import item4 from "../img/item-4.png";
import item5 from "../img/item-5.png";
import item6 from "../img/item-6.png";
import item7 from "../img/item-7.png";
import item8 from "../img/item-8.png";
import item9 from "../img/item-9.png";

const cardBox = [item1, item2, item3, item4, item5, item6, item7, item8, item9];


class HomePage extends React.Component {
    state = {
        item: Data
    };
    render() {
        return (
            <>
                <Header />
                <Hero />
                <ShowItem boxs={this.state.item}/>
                <Newsletter />
                <Footer />
            </>
        );
    }
}

export default HomePage;
